import React from "react";
import emojipedia from "../emojipedia";

function createHeading(emoji) {
  return <Entry key={emoji.id} 
  emoji={emoji.emoji}
  name={emoji.name}
  meaning={emoji.meaning}

  />;
}

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
      {emojipedia.map(createHeading)}
    </div>
  );
}

export default App;
